var title_f24_58_25516="Periop neurologic agents";
var content_f24_58_25516=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F55167&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F55167&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Perioperative management of neurologic agents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Name or class of drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical considerations",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended strategy for surgery with brief NPO state",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended strategy for surgery with prolonged NPO state",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antiepileptics",
"       </td>",
"       <td>",
"        No known adverse effects.",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery. For well controlled seizures can resume with PO intake. Parenteral phenytoin or phenobarbital should be administered in patients with difficult to control seizures.",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery.Parenteral phenytoin or phenobarbital should be administered. These could be substituted for other antiepileptics with no parenteral substitute.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Levodopa/Carbidopa",
"       </td>",
"       <td>",
"        Metabolite of Levodopa, dopamine can cause arrhythmias, hypotension or hypertension",
"       </td>",
"       <td>",
"        Continue therapy up to the night before surgery and hold it the day of surgery.",
"       </td>",
"       <td>",
"        Continue therapy up to the night before surgery and hold it the day of surgery. Resume with oral intake as soon as possible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dopamine agonists (Bromocriptine, pramipexole, and ropirinole)",
"       </td>",
"       <td>",
"        Directly stimulate dopamine receptors and can cause arrhythmias or hypotension.",
"       </td>",
"       <td>",
"        Continue therapy up to the night of surgery and hold it for at least 12 hours before surgery.",
"       </td>",
"       <td>",
"        Continue therapy up to the night of surgery and hold it for at least 12 hours before surgery. Resume with oral intake as soon as possible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Selegiline (selective MAO inhibitor)",
"       </td>",
"       <td>",
"        At usual doses for Parkinson disease does not induce hypertension when tyramine containing foods are ingested.",
"       </td>",
"       <td>",
"        Hold the medication the evening before surgery.",
"       </td>",
"       <td>",
"        Hold the medication the evening before surgery. Resume with oral intake.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pyridostigmine",
"       </td>",
"       <td>",
"        Can cause muscarinic side effects.",
"       </td>",
"       <td>",
"        Continue therapy up to the night of surgery. For patients taking long acting preparations substitute short-acting preparations the night before surgery. Restart at half the usual dose when hemodynamically stable.",
"       </td>",
"       <td>",
"        Continue therapy up to the night of surgery. For patients taking long acting preparations substitute short-acting preparations the night before surgery. Restart when hemodynamically stable. Parenteral substitutions are available. For IM substitution give 1/10th the usual oral dose and for IV substitution give 1/30th the usual dose.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
